import React from "react";

const Header = () => {
  return (
    <div>
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/6/64/Netflix_2015_logo.svg"
        alt="Netflix Clone"
      />
    </div>
  );
};

export default Header;
